import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for any "Your Profile" link using text selector (first visible)
    await page.waitForSelector('a:text("Your Profile")', { timeout: 5000 });

    // Use XPath to click the 1st visible "Your Profile" link (to avoid ambiguity)
    const profileLinks = await page.$$('//a[normalize-space(text())="Your Profile"]');
    let clicked = false;
    let profileLinkText = '';
    for (const link of profileLinks) {
      if (await link.isVisible()) {
        profileLinkText = await link.textContent();
        await link.click();
        clicked = true;
        break;
      }
    }
    if (!clicked) throw new Error('No visible "Your Profile" link found');

    // Wait for Jun's profile content to appear (look for Jun's full name)
    await page.waitForSelector('text=Jun Kim', { timeout: 5000 });

    // Take screenshot after navigation
    const step2 = path.join(screenshotsDir, 'step_2_jun_profile.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Extract Jun's profile info from the visible profile header
    const profileHeader = await page.$('.profile-header');
    let profileData = {};
    if (profileHeader) {
      profileData = {
        fullName: await profileHeader.$eval('.profile-info h2', el => el.textContent.trim()),
        username: await profileHeader.$eval('.username', el => el.textContent.trim()),
        bio: await profileHeader.$eval('.bio', el => el.textContent.trim()),
      };
    }

    return {
      success: true,
      action: 'Navigated to Jun\'s Profile page and extracted profile info',
      extractedData: profileData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
